import React from "react";
import { NavLink } from "react-router-dom";

export default () => {
  return (
    <div>
      <ul className="header-links">
        <li>
          <NavLink to="/">Home</NavLink>
        </li>
        <li>
          <NavLink to="/books">Books</NavLink>
        </li>
        <li>
          <NavLink to="/authors">Authors</NavLink>
        </li>
      </ul>
    </div>
  );
};
